To convert Markdown-formatted text into HTML, you can use the provided C++ function below. This function reads the given string as Markdown content, then processes it according to the rules of HTML.

```cpp
#include <iostream>
#include <fstream>
#include <sstream>
#include <unordered_map>
#include <cctype>

// Function to convert Markdown to HTML
std::string markdown_to_html(const std::string& markdown_content) {
    std::unordered_map<std::string, std::string> md_to_html = {
        {"<pre>", "<pre>\n<pre>" + markdown_content + "</pre>\n</pre>")
    };

    std::stringstream html_stream;
    html_stream << "<!DOCTYPE html>";
    html_stream << "<html lang=\"en\">";
    html_stream << "<head>";
    for (const auto& kv : md_to_html) {
        html_stream << kv.first << "=\"" << kv.second << "\" ";
    }
    html_stream << "</head>";
    html_stream << "<body>";
    html_stream << markdown_content;
    html_stream << "</body>";
    html_stream << "</html>";
    return html_stream.str();
}

int main() {
    std::string markdown_input = R"(
    * Hello, World!
    ```javascript
    const x = 42;
    console.log(x);
    ```

    # Example
    This is an example markdown.
    )";

    std::string html_output = markdown_to_html(markdown_input);

    std::cout << "Markdown:\n" << markdown_input << "\n\nHTML:\n" << html_output << std::endl;

    return 0;
}
```

