In TypeScript, you can indicate that an object or variable might have multiple possible types at runtime by specifying all required types explicitly using the `of` keyword or by providing the full tuple literal when declaring the variable.

Here's an example:

```typescript
type User = {
  id: number;
  name: string;
};

const user1: User = { id: 123, name: "Alice" };
const user2: User = { id: 456, name: "Bob" };

// Both 'user1' and 'user2' are of type User.
```

Alternatively, if you don't need to enforce strict typing (which is not always recommended), you could use a wildcard (`*`) after the parameter name:

```typescript
type User = {
  [key: string]: any; // Allows for any number of keys without knowing their exact values ahead of time.
};
```

In this case, `User` can represent an arbitrary number of properties, allowing for potential values like `{ id: 123, name: "Alice" }`, `{ id: 456, name: "Bob" }`, etc., while still being explicit about the expected structure.

