output_2:
To determine whether a given integer `n` is a power of three, we can use logarithms. A number \( n \) is a power of three if and only if the logarithm base 3 of \( n \) equals 1 (since \( 3^1 = 3 \)). Mathematically, this can be expressed as:

\[ \log_3(n) = 1 \]

The C# code to solve this problem would involve computing the logarithm of `n` to the base 3 using the Math class and checking if the result is equal to 1.

Here's the implementation in Java:

```csharp
using System;

public class PowerOfThree {
    // Calculate the logarithm base 3 of n
    private double logBase3(double n) {
        return Math.Log(n) / Math.Log(3);
    }

    public bool IsPowerOfThree(int n) {
        return Math.Abs(logBase3(n) - 1) < Double.E - 1; // Ensure the result is very close to 1 for comparison
    }
}

// Example check function
public static void Check() {
    var solver = new PowerOfThree();
    Console.WriteLine(solver.IsPowerOfThree(27)); // Expected: True
    Console.WriteLine(solver.IsPowerOfThree(0));   // Expected: False
    Console.WriteLine(solver.IsPowerOfThree(-1));  // Expected: False
}
```

This solution leverages the properties of logarithms to efficiently calculate the required logarithm value and checks its accuracy. The example check function demonstrates the usage of the `IsPowerOfThree` method with the provided examples.

