To create a C++ program that reads a text file line by line and counts the occurrences of a specific word, you can use the following approach:

1. Include the necessary headers: `iostream` for input/output operations, `<string>` to handle strings, and `<fstream>` to work with files.

2. Open the file using `std::ifstream`.

3. Initialize a counter to keep track of how many times the specified word appears.

4. Read each line from the file using the `getline()` function, which splits the string into individual words.

5. Check if the current word matches the target word (specified by your variable).

6. If it does match, increment the counter.

7. After reading all lines, print the final count or some other appropriate message indicating the result.

Here's a sample implementation:

```cpp
#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::ifstream inputFile("input.txt");
    if (!inputFile.is_open()) {
        std::cerr << "Error opening the file." << std::endl;
        return 1;
    }

    int wordCount = 0;

    // Read each line from the file
    std::string line;
    while (std::getline(inputFile, line)) {
        size_t wordStart = 0;
        while ((wordStart = line.find_first_of(" ", wordStart)) != std::string::npos) {
            auto searchWord = line.substr(wordStart);
            if (searchWord == word) {
                ++wordCount;
                break; // Break once we find the first occurrence
            }
        }
    }

    inputFile.close();

    std::cout << "The word '" << word << "' appears " << wordCount << " times." << std::endl;

    return 0;
}
```

